import React, { Fragment } from 'react';
import Snippet from '../Components/Snippet'
import { Collapsible, Row, Col } from 'react-materialize'
import Search from '../Components/Search'

const SnippetContainer = ({snippets, user, updateSnippet, handleSearch, deleteSnippet}) => (
  <Fragment>
    <Row>
      <Col s={12}>
        <Search handleSearch={handleSearch}/>
      </Col>
    </Row>
    <Row>
      <Collapsible popout defaultActiveKey={1}>
        {snippets.map((snippet) => {
          return <Snippet key={snippet.id} deleteSnippet={deleteSnippet} snippet={snippet} updateSnippet={updateSnippet} user={user}/>
        })}
      </Collapsible>
    </Row>
  </Fragment>
);

export default SnippetContainer;
